import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Auth0Provider } from '@auth0/auth0-react';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

const Routing = () => (
  <BrowserRouter>
    <Routes>

      <Route path="pages" element={<Layout />}>
        <Route path="marketDetail/:id" element={<MarketDetail />} />
      </Route>
      <Route path="/register" element={<Register />} />
      <Route path="/login" element={<Login />} />
      <Route path="" element={<Layout />}>
        <Route path="/cart" element={<Cart />} />
      </Route>
      <Route path="/cart" element={<Cart />} />
      <Route path="/user" element={<User />} />
      <Route path="/activate/:hash" element={<ActivateAcount />} />
      <Route path="/resetPass/:hash" element={<ResetPassword />} />
    </Routes>
  </BrowserRouter>
);




ReactDOM.render(
  <React.StrictMode>
    <Auth0Provider
      domain="dev-aj9iwtvo.us.auth0.com"
      clientId="seEglm3LgcJQTuKiolyjA574WeH8JHKE"
      redirectUri={window.location.origin}
    >
      <App />
    </Auth0Provider>
  </React.StrictMode>,
  document.getElementById('root'),
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
